import Link from 'next/link';
import { Navbar, Nav } from 'react-bootstrap';

const linkStyle = {
  marginRight: 15
};

const Header = () => (

  <Navbar bg="light" expand="lg">
    <Navbar.Brand>michaeldipaolo.com</Navbar.Brand>
    <Navbar.Toggle aria-controls="basic-navbar-nav" />
    <Navbar.Collapse id="basic-navbar-nav">
      <Nav className="mr-auto">
      <Link href="/">
        <a style={linkStyle}>Home</a>
      </Link>
      <Link href="/resume">
        <a style={linkStyle}>Resume</a>
      </Link>
      <Link href="/kits">
        <a style={linkStyle}>Kits</a>
      </Link>
      <Link href="https://myanimelist.net/animelist/NotMichael?status=7&order=4&order2=0">
        <a style={linkStyle}>MAL</a>
      </Link>
      {/* <Link href="/tictactoe">
        <a style={linkStyle}>TicTacToe</a>
      </Link> */}
      </Nav>
    </Navbar.Collapse>
  </Navbar>

);

export default Header;
